     <script>
          const getVideo = (reversed) => reversed ? document.getElementById("video-reversed") : video = document.getElementById("video")

          function revealVideo(reversed) {
               if (reversed) {
                    document.getElementById("video").style.display = "none"
                    document.getElementById("video-reversed").style.display = "block"
               } else {
                    document.getElementById("video-reversed").style.display = "none"
                    document.getElementById("video").style.display = "block"
               }
          }

          let inAnimation = false
          const queue = []

          function closePods() {
               if (inAnimation) return queue.push(closePods)
               inAnimation = true

               const video = getVideo(true)
               video.currentTime = 0

               revealVideo(true)
               getVideo().currentTime = 0

               video.play()
               video.addEventListener("ended", () => {
                    inAnimation = false;
                    (queue.pop() || (() => { }))()
               }, { once: true })
          }

          function openPods() {
               if (inAnimation) return queue.push(openPods)
               inAnimation = true

               const video = getVideo()
               video.currentTime = 0

               revealVideo()
               getVideo(true).currentTime = 0

               video.addEventListener("ended", () => {
                    inAnimation = false;
                    (queue.pop() || (() => { }))()
               }, { once: true })
               video.play()
          }

          //<x:Function>
     </script>
